const e="dmExam1",a="Tutorial",t="Examen diagnóstico",r=[{id:"1",type:"Information",sections:[{type:"TextBox",text:"Funciones"},{type:"Paragraph",text:"Una función es simplemente una expresión que tiene algunas x."},{type:"TextBox",text:"La clave está en encontrar el valor de la función cuando tú le das un valor a x."},{type:"Paragraph",text:"Por ejemplo, para la función f(x) = 3x, si yo digo que x = 3, entonces la función vale f(3) = 3(3) = 9, porque lo único que debemos hacer cambiar cada x por el 3 y hacer las operaciones."}]},{id:"2",type:"MultipleOption",sections:[{type:"Paragraph",text:"Para la función dada, determina el valor de f(-2):"},{type:"Formula",formula:"f(x) = 3x^{2} -2x + 1"}],options:[{value:"-7"},{value:"-15"},{value:"17",correct:!0},{value:"9"}]},{id:"3",type:"MultipleOption",sections:[{type:"Paragraph",text:"Para la función:"},{type:"Formula",formula:"f(x) = 2x^{2} -3x"},{type:"Paragraph",text:"¿Cuál es el valor de la siguiente operación?:"},{type:"Formula",formula:"\\frac{f(6)}{f(2)}-f(1)"}],options:[{value:"4"},{value:"26"},{value:"28",correct:!0},{value:"32"}]},{id:"4",type:"Information",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"Piensa en el límite como un muro al que te vas a acercar cada vez más y más."},{type:"TextBox",text:"Pero no necesariamente vas a tocar"}]},{id:"5",type:"Information",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"Para entenderlo mejor, veamos la siguiente secuencia:"},{type:"TextBox",text:"9, 9.9, 9.99, 9.999"},{type:"Paragraph",text:"¿Cuál crees que sea el límite de esta secuencia?"},{type:"TextBox",text:"¡Exacto, es el 10!"},{type:"Paragraph",text:"Porque es el valor al cual se va acercando cada vez más y más, pero sin tocarlo"}]},{id:"6",type:"Information",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"El límite de una función se puede visualizar bien con la siguiente gráfica:"},{type:"Image",fileName:"limExample1"},{type:"Paragraph",text:'La expresión x -> a significa que vamos a acercarnos cada vez más y más al valor "a" en el eje X, ¡pero sin tocarlo!.'},{type:"Paragraph",text:"Al hacer esto, los valores del eje Y se acercarán más y más a un valor (que en este caso es L) y ese valor será nuestro límite."}]},{id:"7",type:"MultipleOption",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"En base a la gráfica de f(x), determina el límite que se indica:"},{type:"Formula",formula:"\\lim_{x \\to 3} f(x) "},{type:"Image",fileName:"limExample2"}],options:[{value:"No existe",correct:!0},{value:"2"},{value:"1"},{value:"-2"}]},{id:"8",type:"Information",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"TextBox",text:"¡Esto es súper importante que lo sepas!"},{type:"Paragraph",text:"Cuando te da resultados distintos el acercarte por la derecha que acercarte por la izquierda (como fue el caso anterior)"},{type:"TextBox",text:"entonces el límite no existe"}]},{id:"9",type:"Information",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"La mayoría de los límites se resuelven sustituyendo directamente el valor de x que viene junto a la flechita x->a en la función."},{type:"Formula",formula:"\\text{Si al hacer esto, te da } \\frac{0}{0} \\text{ o } \\frac{\\infty }{\\infty}"},{type:"Paragraph",text:"entonces debes aplicar factorización o regla de L’Hopital."}]},{id:"10",type:"MultipleOption",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"Calcula el límite:"},{type:"Formula",formula:"\\lim_{x \\to 2}(\\frac{x^2-4}{x-2}) "}],options:[{value:"No existe"},{value:"4",correct:!0},{value:"0"},{value:"2"}]},{id:"11",type:"MultipleOption",sections:[{type:"TextBox",text:"Concepto de límite"},{type:"Paragraph",text:"Calcula el límite:"},{type:"Formula",formula:"\\lim_{x \\to \\infty }(\\frac{6x^2-2x+1}{3x^2 + 2}) "}],options:[{value:"2",correct:!0},{value:"3"},{value:"0"},{value:"Infinito"}]},{id:"12",type:"Information",sections:[{type:"TextBox",text:"Derivadas"},{type:"Paragraph",text:"Tu mejor amigo aquí siempre será tu formulario"},{type:"TextBox",text:"¡Jamás lo olvides!"}]},{id:"13",type:"Information",sections:[{type:"Paragraph",text:"Tu segundo mejor amigo será la regla de la cadena, esta se entenderá mejor con un ejemplo:"},{type:"Formula",formula:"\\text{Imagina que tienes } y=cos(x)"},{type:"Formula",formula:"\\text{Su derivada es } y'=-sen(x)"}]},{id:"14",type:"Information",sections:[{type:"Formula",formula:"\\text{¿Y si tienes } cos(3x^2) \\text{ ?}"},{type:"Formula",formula:"\\text{En lugar de } x \\text{ ahora es } 3x^2"},{type:"Paragraph",text:"Simplemente haz esto, aplica primero la fórmula tal cual viene en tu formulario, es decir, solo convierte:"},{type:"Formula",formula:"cos(3x^2) \\to -sen(3x^2)"},{type:"Paragraph",text:"Y después multiplica por la derivada de lo que viene dentro, que en este caso la derivada es 6x."}]},{id:"15",type:"Information",sections:[{type:"TextBox",text:"¡La respuesta correcta puede venir en forma factorizada!"},{type:"Paragraph",text:"No olvides tener las fórmulas de factorización más comunes en tu formulario: factor común, trinomio al cuadrado perfecto, diferencia de cuadrados, etc."}]},{id:"16",type:"MultipleOption",sections:[{type:"Paragraph",text:"¿Cuál es la derivada de la siguiente función?"},{type:"Formula",formula:"y = \\sqrt{x}"}],options:[{value:"y' = \\frac{1}{2\\sqrt{x}}",formula:"y' = \\frac{1}{2\\sqrt{x}}"},{value:"y' = \\frac{1}{2}\\sqrt{x}",formula:"y' = \\frac{1}{2}\\sqrt{x}",correct:!0},{value:"y' = -\\frac{1}{2}\\sqrt{x}",formula:"y' = -\\frac{1}{2}\\sqrt{x}"},{value:"y' = -\\frac{1}{2\\sqrt{x}}",formula:"y' = -\\frac{1}{2\\sqrt{x}}"}]},{id:"17",type:"MultipleOption",sections:[{type:"Paragraph",text:"¿Cuál es la derivada de la siguiente función?"},{type:"Formula",formula:"y = sin(2x)"}],options:[{value:"y' = -cos(2x)",formula:"y' = -cos(2x)"},{value:"y' = cos(2x)",formula:"y' = cos(2x)"},{value:"y' = -2 cos(2x)",formula:"y' = -2 cos(2x)"},{value:"y' = 2 cos(2x)",formula:"y' = 2 cos(2x)",correct:!0}]},{id:"18",type:"MultipleOption",sections:[{type:"Paragraph",text:"¿Cuál es la derivada de la siguiente función?"},{type:"Formula",formula:"y' = 3e^{2x}"}],options:[{value:"y' = 5e^{2x}",formula:"y' = 5e^{2x}"},{value:"y' = 2e^{2x}",formula:"y' = 2e^{2x}"},{value:"y' = 6e^{2x}",formula:"y' = 6e^{2x}",correct:!0},{value:"y' = 6e^{3x}",formula:"y' = 6e^{3x}"}]},{id:"19",type:"MultipleOption",sections:[{type:"Paragraph",text:"¿Cuál es la derivada de la siguiente función?"},{type:"Formula",formula:"y' = sin^{-1}(2x-5)"}],options:[{value:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(x-2)}}",formula:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(x-2)}}"},{value:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(x-3)(x-2)}}",formula:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(x-3)(x-2)}}",correct:!0},{value:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(2-x)}}",formula:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(2-x)}}"},{value:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(2+x)}}",formula:"\\frac{dy}{dx} = \\frac{1}{\\sqrt{(3-x)(2+x)}}"}]},{id:"20",type:"Information",sections:[{type:"Paragraph",text:"Para las funciones del estilo:"},{type:"Formula",formula:"f(x) = (4x-5)^{3}"},{type:"TextBox",text:"¡Puedes aplicar la regla de la cade más fácil!"},{type:"Paragraph",text:"1. Primero usamos la fórmula directa"},{type:"Paragraph",text:"2. Y después multiplicamos por la derivada de lo de adentro"}]},{id:"21",type:"Information",sections:[{type:"Paragraph",text:"Para nuestro caso primero usamos la fórmula:"},{type:"Formula",formula:"\\frac{d}{dx}(ax^{n})=anx^{-1}"},{type:"Paragraph",text:"Solo que en lugar de x tenemos 4x-5, lo que nos deja con:"},{type:"Formula",formula:"3(4x-5)^{2}"},{type:"Paragraph",text:"Lo que hicimos fue bajar el 3 al exponente restarle 1. Luego lo multiplicamos por la dericada de 4x-5 (lo de adentro) que da 4, por lo que nuestro resultado es:"},{type:"Formula",formula:"\\frac{d}{dx}(4x-5)^{3}=3(4x-5)^{2}(4)"}]},{id:"22",type:"MultipleOption",sections:[{type:"Paragraph",text:"¿Cuál es la segunda derivada de la siguiente función?"},{type:"Formula",formula:"f(x) = (4x-5)^{3}"}],options:[{value:"f''(x) = 384x - 91",formula:"f''(x) = 384x - 91"},{value:"f''(x) = 405x - 470",formula:"f''(x) = 405x - 470"},{value:"f''(x) = 364x - 420",formula:"f''(x) = 364x - 420"},{value:"f''(x) = 384x - 480",formula:"f''(x) = 384x - 480",correct:!0}]},{id:"23",type:"MultipleOption",sections:[{type:"Paragraph",text:"Obtener y' de la siguiente función"},{type:"Formula",formula:"y^{2}=12x"}],options:[{value:"y'=\\frac{4}{y}",formula:"y'=\\frac{4}{y}"},{value:"y'= 4y",formula:"y'= 4y"},{value:"y'=\\frac{6}{y}",formula:"y'=\\frac{6}{y}",correct:!0},{value:"y'= 6y",formula:"y'= 6y"}]},{id:"24",type:"Information",sections:[{type:"Paragraph",text:"Cuando tengas la variable Y con exponentes o dentro de una función entonces también la regla de la cadena es tu salvadora."},{type:"TextBox",text:"Lo que debes hacer es aplicar la derivada en ambos lados"},{type:"Paragraph",text:"En el ejemplo anterior teníamos:"},{type:"Formula",formula:"\\frac{d}{dx}y^{2}=\\frac{d}{dx}12x"},{type:"Paragraph",text:"Del lado derecho la respuesta es 12, pero del lado izquierdo aplicas la regla de la cadena"},{type:"Formula",formula:"\\frac{d}{dx}y^{2}=(2x) \\frac{d}{dx}(y)"}]},{id:"25",type:"Information",sections:[{type:"Paragraph",text:"Entonces tenemos:"},{type:"Formula",formula:"2y\\frac{d}{dx}(y) = 12"},{type:"Paragraph",text:"Y lo único que hacemos es despejar:"},{type:"Formula",formula:"\\frac{d}{dx}(y)"},{type:"Paragraph",text:"Por lo que pasamos el 2y diviendo a la izquierda y nos queda:"},{type:"Formula",formula:"\\frac{d}{dx}(y)=\\frac{12}{2y}=\\frac{6}{y}"}]},{id:"26",type:"MultipleOption",sections:[{type:"Paragraph",text:"Obtener y' de la siguiente función:"},{type:"Formula",formula:"4x^{2}-9y^{2} = 36"}],options:[{value:"y'=-\\frac{4x}{9y}",formula:"y'=-\\frac{4x}{9y}"},{value:"y'=\\frac{x}{2y}",formula:"y'=\\frac{x}{2y}"},{value:"y'=\\frac{4x}{9y}",formula:"y'=\\frac{4x}{9y}",correct:!0},{value:"y'= 4x-9y",formula:"y'= 4x-9y"}]},{id:"27",type:"Information",sections:[{type:"Paragraph",text:"Recuerda, antes de aplicar la regla de la cadena:"},{type:"TextBox",text:"Debes tener todas las Y de un lado y todas las X del otro"},{type:"Paragraph",text:"En el ejemplo anterior el -9y^2 se queda solo a la izquierda y el 4x^2 se pone a la derecha. Los números sin letra preferentemente deben ir con las X, por lo que el 36 va con el 4x^2 en la derecha."}]}],o={id:e,type:a,title:t,content:r};export{r as content,o as default,e as id,t as title,a as type};
